import React from "react";
import Button from "@material-ui/core/Button";

export default class Btn extends React.Component() {
  render() {
    return (
      <Button
        variant="contained"
        href="#contained-buttons"
        className={classes.button}
      >
        Link
      </Button>
    );
  }
}
